from Crypto.Util.number import inverse

def _break(n: int, c: int, factor: str):
    e = 65537
    p, q = factor.split('=')[1].replace(" ", "").split("×")
    phi = n-(int(p)+int(q)-1)
    d = inverse(e, phi)
    dec = hex(pow(c, d, n))[2:]
    print(bytes.fromhex(dec).decode())

